import React, { useState } from 'react';
import { Form } from 'react-bootstrap';
import FormCheckLabel from 'react-bootstrap/esm/FormCheckLabel';

function Checkout() {

  let [paymentMethod, setpaymentMethod ] = useState('');

  return (
    <div className='Checkout'>
      <h1>Checkout</h1>
      <Form id='payment'>
        <div className="mb-3">
          <Form.Check
            onClick={setpaymentMethod = FormCheckLabel}
            inline
            label="Pay by check"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-1"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={setpaymentMethod = FormCheckLabel}
            inline
            label="Credit-/Debitcard"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-2"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={setpaymentMethod = FormCheckLabel}
            inline
            label="TWINT"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-3"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={setpaymentMethod = FormCheckLabel}
            inline
            label="Apple Pay"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-4"
          />
        </div>
      </Form>
      <p>{paymentMethod }</p>
    </div>
  );
};

export default Checkout;
